<template>
    <div>
        <img id="myImg" :style="{width: '200px', height: '200px'}"
             src="data:image/jpeg;base64,">

        <div>
            主色:
            <div :style="{width: '50px',height: '50px', backgroundColor: primaryBgColor}"></div>
        </div>

        <div>
            次色：
            <div>
                <div :style="{display: 'inline-block',width: '50px',height: '50px', backgroundColor: item.bgColor}"
                     v-for="(item, index) in pletteBgColors" :key="index">

                </div>
            </div>
        </div>
    </div>
</template>

<script>
    import ColorThief from '../core/color-thief';

    export default {
        name: "Home",
        data() {
            return {
                primaryBgColor: '',
                pletteBgColors: []
            }
        },
        mounted() {
            const img = document.getElementById("myImg");
            const colorThief = new ColorThief();
            const primaryColor = colorThief.getColor(img);
            console.log(primaryColor);

            this.primaryBgColor = `rgb(${primaryColor[0]}, ${primaryColor[1]}, ${primaryColor[2]})`

            const pletteColors2 = colorThief.getPalette(img, 20);
            console.log(pletteColors2)

            pletteColors2.forEach((item) => {
                this.pletteBgColors.push({
                    bgColor: `rgb(${item[0]}, ${item[1]}, ${item[2]})`
                });
            });
        }
    }
</script>

